\begin{verbatim}
bode_plot(freq, y...; lw = 1., xlab = "Frequency (Hz)",
          ylab = "Magnitude (dB)", xscale = identity,
          axis_tight = true, isdeg = false, layout = :vertical,
          ref_dB = 1., legend = (active = false, position = :rt, entry = " "))
\end{verbatim}
Plot Bode diagram of a frequency response or a FRF.

\textbf{Inputs}

\begin{itemize}
\item \texttt{freq}: Frequency range of interest


\item \texttt{y}: Frequency response or FRF


\item \texttt{lw}: Line width


\item \texttt{xlab}: x-axis label


\item \texttt{xscale}: x-axis scale (default: :log)


\item \texttt{axis\_tight}: Tight axis (default: false)


\item \texttt{isdeg}: Phase in degrees (default: false)


\item \texttt{layout}: Layout of the plot (default: :vertical)


\item \texttt{ref\_dB}: Reference value for magnitude (default: 1.)


\item \texttt{legend}: Legend parameters (default: (active = false, position = :rt, entry = " "))

\end{itemize}
\textbf{Output}

\begin{itemize}
\item \texttt{fig}: Figure

\end{itemize}

\begin{verbatim}
nyquist_plot(y)
\end{verbatim}
Plot Nyquist diagram

\textbf{Inputs}

\begin{itemize}
\item \texttt{y}: Complex data vector

\end{itemize}
\textbf{Output}

\begin{itemize}
\item \texttt{fig}: Figure

\end{itemize}

\begin{verbatim}
nyquist_plot(freq, y, xlab = "Frequency (Hz)";
             projection = false)
\end{verbatim}
Plot Nyquist diagram in 3D

\textbf{Inputs}

\begin{itemize}
\item \texttt{freq}: Frequency range


\item \texttt{y}: Complex vector


\item \texttt{ylabel}: y-axis label


\item \texttt{projection}: Projection of the curve on the xy, yz, and xz planes (default: false)

\begin{itemize}
\item on the xy plane: (freq, real(y))


\item on the yz plane: (imag(y), freq)


\item on the xz plane: (real(y), imag(y))

\end{itemize}
\end{itemize}
\textbf{Output}

\begin{itemize}
\item \texttt{fig}: Figure

\end{itemize}

\begin{verbatim}
sv_plot(x, y...; lw = 1., xscale = identity, yscale = identity,
        axis_tight = true, title = " ", xlabel = "x", ylabel = "y",
        legend = (active = false, position = :right, orientation = :vertical, entry = " "))
\end{verbatim}
Plot a 2D plot.

\textbf{Inputs}

\begin{itemize}
\item \texttt{x}: x-axis values


\item \texttt{y}: y-axis values


\item \texttt{lw}: linewidth


\item \texttt{xscale}: x-axis scale (default: identity)


\item \texttt{yscale}: y-axis scale (default: identity)


\item \texttt{axis\_tight}: Tight axis (default: true)


\item \texttt{title}: Title of the plot (default: " ")


\item \texttt{xlabel}: x-axis label


\item \texttt{ylabel}: y-axis label


\item \texttt{legend}: Legend parameters

\begin{itemize}
\item active : Bool


\item position : Symbol


\item entry : String

\end{itemize}
\end{itemize}
\textbf{Output}

\begin{itemize}
\item \texttt{fig}: Figure

\end{itemize}

\begin{verbatim}
theme_choice(name::Symbol; fonts = Makie.theme(:fonts),
             titlesize = 20., labelsize = 18., ticklabelsize = 14.)
\end{verbatim}
Choose the theme for the plots.

\textbf{Inputs}

\begin{itemize}
\item \texttt{name}: Name of the theme

\begin{itemize}
\item \texttt{:makie}


\item \texttt{:sv}

\end{itemize}

\item \texttt{fonts}: Fonts of the figure (default: Makie.theme(:fonts))


\item \texttt{titlesize}: Title size (default: 20.)


\item \texttt{labelsize}: Label size (default: 18.)


\item \texttt{ticklabelsize}: Tick label size (default: 14.)

\end{itemize}
\textbf{Output}

\begin{itemize}
\item \texttt{theme}: Theme

\end{itemize}
